webpackJsonp([30174437671933],{662:function(t,i){t.exports={data:{markdownRemark:{html:'<p>Gatsby CLI 工具可以让你安装 “启动器”。它们是预先配置好的站点，以帮助您在创建特定类型的站点时更快地移植。</p>\n<p>当创建一个新站点时，您可以选择指定一个启动器来作为您的新站点的基础。例如：</p>\n<p><code>gatsby new [SITE_DIRECTORY] [URL_OF_STARTER_GITHUB_REPO]</code></p>\n<p>例如，要想使用 Gatsby 快速创建一个博客，你可以安装 Gatsby Starter Blog，如下所示：</p>\n<p><code>gatsby new blog https://github.com/gatsbyjs/gatsby-starter-blog</code></p>\n<p>这将下载文件并通过运行 <code>npm install</code> 来初始化站点</p>\n<p>如果你不指定自定义的启动器，你的站点将使用\n<a href="https://github.com/gatsbyjs/gatsby-starter-default">默认的启动器</a> 被创建。</p>\n<p>这里有几个已经创建的启动器。创建一个 PR 来包含进你的！</p>\n<p>官方的:</p>\n<ul>\n<li><a href="https://github.com/gatsbyjs/gatsby-starter-default">gatsby-starter-default</a>\n<a href="http://gatsbyjs.github.io/gatsby-starter-default/">(demo)</a></li>\n<li><a href="https://github.com/gatsbyjs/gatsby-starter-blog">gatsby-starter-blog</a>\n<a href="http://gatsbyjs.github.io/gatsby-starter-blog/">(demo)</a></li>\n<li><a href="https://github.com/gatsbyjs/gatsby-starter-hello-world">gatsby-starter-hello-world</a>\n<a href="https://aberrant-fifth.surge.sh/">(demo)</a></li>\n</ul>\n<p>社区:</p>\n<ul>\n<li>\n<p><a href="https://github.com/noahg/gatsby-starter-blog-no-styles">gatsby-starter-blog-no-styles</a>\n<a href="http://capricious-spring.surge.sh/">(demo)</a></p>\n<p>特性:</p>\n<ul>\n<li>与官方的 gatsby-starter-blog 相同，但是所有的样式都被移除</li>\n</ul>\n</li>\n<li>\n<p><a href="https://github.com/Vagr9K/gatsby-material-starter">gatsby-material-starter</a>\n<a href="https://vagr9k.github.io/gatsby-material-starter/">(demo)</a></p>\n<p>特性:</p>\n<ul>\n<li>React-MD for Material design</li>\n<li>SASS/SCSS</li>\n<li>Tags</li>\n<li>Categories</li>\n<li>Google Analytics</li>\n<li>Disqus</li>\n<li>Offline support</li>\n<li>Web App Manifest</li>\n<li>SEO</li>\n<li><a href="https://github.com/Vagr9K/gatsby-material-starter#features">完整列表!</a></li>\n</ul>\n</li>\n<li>\n<p><a href="https://github.com/fabien0102/gatsby-starter">gatsby-typescript-starter</a>\n<a href="https://fabien0102-gatsby-starter.netlify.com/">(demo)</a></p>\n<p>特性:</p>\n<ul>\n<li>Semantic-ui for styling</li>\n<li>TypeScript</li>\n<li>Offline support</li>\n<li>Web App Manifest</li>\n<li>Jest/Enzyme testing</li>\n<li>Storybook</li>\n<li>Markdown linting</li>\n<li><a href="https://github.com/fabien0102/gatsby-starter#whats-inside">Full list here!</a></li>\n</ul>\n</li>\n<li>\n<p><a href="https://github.com/jaxx2104/gatsby-starter-bootstrap">gatsby-starter-bootstrap</a>\n<a href="https://jaxx2104.github.io/gatsby-starter-bootstrap/">(demo)</a></p>\n<p>特性:</p>\n<ul>\n<li>Bootstrap CSS framework</li>\n<li>Single column layout</li>\n<li>Simple components: SiteNavi, SitePost, SitePage</li>\n</ul>\n</li>\n<li>\n<p><a href="https://github.com/dschau/gatsby-blog-starter-kit">gatsby-blog-starter-kit</a></p>\n<p>特性:</p>\n<ul>\n<li>带预览的博客文章列表</li>\n<li>使用 previous/next 按钮的文章导航</li>\n<li>标签和标签导航</li>\n</ul>\n</li>\n<li>\n<p><a href="https://github.com/Vagr9K/gatsby-advanced-starter">gatsby-advanced-starter</a>\n<a href="https://vagr9k.github.io/gatsby-advanced-starter/">(demo)</a></p>\n<p>特性:</p>\n<ul>\n<li>Great for learning about advanced features and their implementations</li>\n<li>Does not contain any UI frameworks</li>\n<li>Provides only a skeleton</li>\n<li>Tags</li>\n<li>Categories</li>\n<li>Google Analytics</li>\n<li>Disqus</li>\n<li>Offline support</li>\n<li>Web App Manifest</li>\n<li>SEO</li>\n<li><a href="https://github.com/Vagr9K/gatsby-advanced-starter#features">Full list here!</a></li>\n</ul>\n</li>\n<li>\n<p><a href="https://github.com/100ideas/glitch-gatsby-starter-blog/">glitch-gatsby-starter-blog</a>\n(<a href="https://gatsby-starter-blog.glitch.me">demo</a>)</p>\n<p>特性:</p>\n<ul>\n<li><a href="https://glitch.com/edit/#!/remix/gatsby-starter-blog">live-edit</a> a temp,\nanon copy of app</li>\n<li>same code as\n<a href="https://github.com/gatsbyjs/gatsby-starter-blog">gatsby-starter-blog</a>\n(mostly)</li>\n<li>free hosting &#x26; web IDE on glitch.com</li>\n<li>HMR working w/ glitch IDE (see\n<a href="https://github.com/100ideas/glitch-gatsby-starter-blog/blob/5fce8999bd952087ecdc74c9787a0cb3cb884371/README.md#enabling-hmr">note</a>)</li>\n<li>谨慎:</li>\n<li>app running in <strong>develop</strong> mode</li>\n<li>glitch serves assets over CDN, API unclear</li>\n<li>virtual server container provides\n<a href="https://glitch.com/faq#restrictions"><strong>128MB</strong> for app</a> (512MB for\nassets)</li>\n<li>server can’t install certain gatsby plugins (<code>sharp</code>-based; out of mem?)</li>\n</ul>\n</li>\n<li>\n<p><a href="https://github.com/alampros/gatsby-starter-grommet">gatsby-starter-grommet</a>\n<a href="https://alampros.github.io/gatsby-starter-grommet/">(demo)</a></p>\n<p>特性:</p>\n<ul>\n<li>Barebones configuration for using the <a href="https://grommet.github.io/">Grommet</a>\ndesign system</li>\n<li>Uses SASS (with CSS modules support)</li>\n</ul>\n</li>\n<li>\n<p><a href="https://github.com/PrototypeInteractive/gatsby-react-boilerplate">gatsby-starter-basic</a>\n<a href="https://prototypeinteractive.github.io/gatsby-react-boilerplate/">(demo)</a></p>\n<p>特性:</p>\n<ul>\n<li>Basic configuration and folder structure</li>\n<li>Uses postcss and sass (with autoprefixer and pixrem)</li>\n<li>Uses boostrap 4 grid</li>\n<li>Leaves the styling to you</li>\n<li>Uses data from local json files</li>\n<li>Contains Node.js server code for easy, secure, and fast hosting</li>\n</ul>\n</li>\n<li>\n<p><a href="https://github.com/haysclark/gatsby-starter-typescript">gatsby-starter-typescript</a>\n<a href="https://haysclark.github.io/gatsby-starter-typescript/">(demo)</a></p>\n<p>特性:</p>\n<ul>\n<li>TypeScript</li>\n</ul>\n</li>\n<li>\n<p><a href="https://github.com/angeloocana/gatsby-starter-default-i18n">gatsby-starter-default-i18n</a>\n<a href="https://gatsby-starter-default-i18n.netlify.com">(demo)</a></p>\n<p>特性:</p>\n<ul>\n<li>localization (Multilanguage)</li>\n</ul>\n</li>\n<li>\n<p><a href="https://github.com/saschajullmann/gatsby-starter-gatsbythemes">gatsby-starter-gatsbythemes</a>\n<a href="https://themes.gatsbythemes.com/gatsby-starter/">(demo)</a></p>\n<p>特性:</p>\n<ul>\n<li>CSS-in-JS via <a href="https://github.com/emotion-js/emotion">Emotion</a>.</li>\n<li>Jest and Enzyme for testing.</li>\n<li>Eslint in dev mode with the airbnb config and prettier formatting rules.</li>\n<li>React 16.</li>\n<li>A basic blog, with posts under src/pages/blog. There’s also a script which\ncreates a new Blog entry (post.sh).</li>\n<li>Data per JSON files.</li>\n<li>A few basic components (Navigation, Footer, Layout).</li>\n<li>Layout components make use of\n<a href="https://github.com/jxnblk/styled-system">Styled-System</a>.</li>\n<li>Google Analytics (you just have to enter your tracking-id).</li>\n<li>Gatsby-Plugin-Offline which includes Service Workers.</li>\n<li><a href="https://github.com/prettier/prettier">Prettier</a> for a uniform codebase.</li>\n<li><a href="https://github.com/necolas/normalize.css/">Normalize</a> css (7.0).</li>\n<li><a href="https://feather.netlify.com/">Feather</a> icons.</li>\n<li>Font styles taken from <a href="http://tachyons.io/">Tachyons</a>.</li>\n</ul>\n</li>\n<li>\n<p><a href="https://github.com/AustinGreen/gatsby-starter-netlify-cms">gatsby-starter-netlify-cms</a>\n<a href="https://gatsby-netlify-cms.netlify.com/">(demo)</a></p>\n<p>特性:</p>\n<ul>\n<li>A simple blog built with Netlify CMS</li>\n<li>Basic directory organization</li>\n<li>Uses <a href="https://bulma.io/">Bulma</a> for styling</li>\n<li>Visit <a href="https://github.com/AustinGreen/gatsby-starter-netlify-cms">the repo</a>\nto learn how to set up authentication, and begin modeling your content.</li>\n</ul>\n</li>\n<li>\n<p><a href="https://github.com/LeKoArts/gatsby-starter-portfolio-emma">gatsby-starter-portfolio-emma</a>\n<a href="https://embalmer-glues-43220.netlify.com/">(demo)</a></p>\n<p>特性:</p>\n<ul>\n<li>Perfect for designers and photographers</li>\n<li>Full-width Photo Grid-Layout (Responsive Images through\n<a href="https://using-gatsby-image.gatsbyjs.org/">gatsby-image</a>)</li>\n<li>Minimalistic light theme with large images</li>\n<li>Create your projects in Markdown</li>\n<li>Styling with SCSS and\n<a href="https://kyleamathews.github.io/typography.js/">Typography.js</a></li>\n<li>Easily configurable</li>\n<li>And other good stuff (SEO, Offline Support, WebApp Manifest Support)</li>\n</ul>\n</li>\n<li>\n<p><a href="https://github.com/konsumer/gatsby-starter-bootstrap-netlify">gatsby-starter-bootstrap-netlify</a>\n<a href="https://gatsby-starter-bootstrap-netlify.netlify.com">(demo)</a></p>\n<p>特性:</p>\n<ul>\n<li>Very similar to\n<a href="https://github.com/AustinGreen/gatsby-starter-netlify-cms">gatsby-starter-netlify-cms</a>,\nslightly more configurable (eg set site-title in <code>gatsby-config</code>) with\nbootstrap/bootswatch instead of bulma</li>\n</ul>\n</li>\n<li>\n<p><a href="https://github.com/rwieruch/open-crowd-fund">open-crowd-fund</a>\n<a href="https://www.roadtolearnreact.com/">(demo)</a></p>\n<p>特性:</p>\n<ul>\n<li>Open source crowdfunding for your own ideas</li>\n<li>Alternative for Kickstarter, GoFundMe, etc.</li>\n<li>Secured Credit Card payments with Stripe</li>\n<li>Storing of funding information in Firebase</li>\n</ul>\n</li>\n<li>\n<p><a href="https://github.com/ChangoMan/gatsby-starter-dimension">gatsby-starter-dimension</a>\n<a href="http://gatsby-dimension.surge.sh/">(demo)</a></p>\n<p>特性:</p>\n<ul>\n<li>Based off of the Dimension site template. Designed by\n<a href="https://html5up.net/dimension">HTML5 UP</a></li>\n<li>Simple one page site that’s perfect for personal portfolios</li>\n<li>Fully Responsive</li>\n<li>Styling with SCSS</li>\n</ul>\n</li>\n<li>\n<p><a href="https://github.com/ericwindmill/gatsby-starter-docs">gatsby-starter-docs</a>\n<a href="https://gatsby-docs-starter.netlify.com/">(demo)</a></p>\n<p>特性:</p>\n<ul>\n<li>All the features from\n<a href="https://github.com/Vagr9K/gatsby-advanced-starter">gatsby-advanced-starter</a>,\nplus:</li>\n<li>Designed for Documentation / Tutorial Websites</li>\n<li>‘Table of Contents’ Component: Auto generates ToC from posts - just follow\nthe file frontmatter conventions from markdown files in ‘lessons’.</li>\n<li>Styled Components w/ ThemeProvider</li>\n<li>Basic UI</li>\n<li>A few extra components</li>\n<li>Custom prismjs theme</li>\n<li>React Icons</li>\n</ul>\n</li>\n<li>\n<p><a href="https://github.com/greglobinski/gatsby-styled-blog-starter">gatsby-styled-blog-starter</a>\n<a href="https://gsbs.greglobinski.com/">(demo)</a></p>\n<p>特性:</p>\n<ul>\n<li>sidebar navigation</li>\n<li>look like an app</li>\n<li>page transitions</li>\n<li>pwa</li>\n<li>styling with styled-components</li>\n<li>easily restyled through theme object</li>\n<li><a href="https://github.com/greglobinski/gatsby-styled-blog-starter">README</a></li>\n</ul>\n</li>\n<li>\n<p><a href="https://github.com/fabe/gatsby-starter-deck">gatsby-starter-deck</a>\n<a href="https://gatsby-deck.netlify.com/">(demo)</a></p>\n<p>特性:</p>\n<ul>\n<li>Create presentations/slides using Gatsby.</li>\n<li>Offline support.</li>\n<li>Page transitions.</li>\n</ul>\n</li>\n<li>\n<p><a href="https://github.com/ChangoMan/gatsby-starter-forty">gatsby-starter-forty</a>\n<a href="http://gatsby-forty.surge.sh/">(demo)</a></p>\n<p>特性:</p>\n<ul>\n<li>Based off of the Forty site template. Designed by\n<a href="https://html5up.net/forty">HTML5 UP</a></li>\n<li>Colorful homepage, and also includes a Landing Page and Generic Page components.</li>\n<li>Many elements are available, including buttons, forms, tables, and pagination.</li>\n<li>Styling with SCSS</li>\n</ul>\n</li>\n<li>\n<p><a href="https://github.com/rwieruch/gatsby-firebase-authentication">gatsby-firebase-authentication</a> <a href="https://react-firebase-authentication.wieruch.com/">(demo)</a></p>\n<p>特性:</p>\n<ul>\n<li>Sign In, Sign Up, Sign Out</li>\n<li>Password Forget</li>\n<li>Password Change</li>\n<li>Protected Routes with Authorization</li>\n<li>Realtime Database with Users</li>\n</ul>\n</li>\n</ul>',excerpt:"Gatsby CLI 工具可以让你安装 “启动器”。它们是预先配置好的站点，以帮助您在创建特定类型的站点时更快地移植。 当创建一个新站点时，您可以选择指定一个启动器来作为您的新站点的基础。例如： gatsby new [SITE_DIRECTORY] [URL_OF…",timeToRead:7,frontmatter:{title:"Gatsby 启动器"},parent:{__typename:"File",relativePath:"docs/gatsby-starters.md"}}},pathContext:{slug:"/docs/gatsby-starters/"}}}});
